#include <vector>
#include <string>
#include <algorithm>
#include <limits.h>

using namespace std;

class Solution {
public:
    int minimumChanges(string s, int k) {
        int n = s.size();
        vector<vector<int>> changes(n, vector<int>(n, 0));
        for (int len = 2; len <= n; ++len) {
            for (int i = 0; i <= n - len; ++i) {
                int j = i + len - 1;
                changes[i][j] = changes[i + 1][j - 1] + (s[i] != s[j]);
            }
        }

        vector<vector<int>> dp(k, vector<int>(n, INT_MAX));
        for (int i = 0; i < n; ++i) {
            dp[0][i] = changes[0][i];
        }

        for (int i = 1; i < k; ++i) {
            for (int j = i; j < n; ++j) {
                for (int m = i - 1; m < j; ++m) {
                    if (dp[i - 1][m] != INT_MAX) {
                        dp[i][j] = min(dp[i][j], dp[i - 1][m] + changes[m + 1][j]);
                    }
                }
            }
        }

        return dp[k - 1][n - 1];
    }
};
